-- ------------------------------------------------
-- Version: v1.5
--
-- Description: Migration that introduces the manager table
-- -------------------------------------------------

CREATE TABLE k_Manager (
    lodMAN character varying(255) NOT NULL,
    MAN character varying(255),
    labelManager character varying(255),
    descManager text,
    lodMAN_V character varying(255),
    Certification text,
    Country text,
    startDate timestamp with time zone,
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lodMAN)
);

